//index.js
//获取应用实例
var app = getApp()

Page({
  data: {
    motto: 'Copyright@不愿意透露姓名的小组',
    userInfo: {},
    hasUserInfo: false,
    canIUse: wx.canIUse('button.open-type.getUserInfo'),
    academy: null,
    number: null,
    name: null,
    me_jpg: "data:image/jpg;base64,"
  },

  onLoad: function() {
    console.log(app.globalData.userinfo)
    if (app.globalData.userinfo['type'] === "admin") {
      this.setData({
        userType: 1,
      })
    } else {
      this.setData({
        userType: 0,
      })
    }
    this.setData({
      number: app.globalData.userinfo['username'],
      academy: app.globalData.userinfo['academy'],
      name: app.globalData.userinfo['name']
    })
    console.log(this.data.name)
    if (app.globalData.userInfo) {
      this.setData({
        userInfo: app.globalData.userInfo,
        hasUserInfo: true
      })
    } else if (this.data.canIUse) {
      // 由于 getUserInfo 是网络请求，可能会在 Page.onLoad 之后才返回
      // 所以此处加入 callback 以防止这种情况
      app.userInfoReadyCallback = res => {
        this.setData({
          userInfo: res.userInfo,
          hasUserInfo: true
        })
      }
    } else {
      // 在没有 open-type=getUserInfo 版本的兼容处理
      wx.getUserInfo({
        success: res => {
          app.globalData.userInfo = res.userInfo
          this.setData({
            userInfo: res.userInfo,
            hasUserInfo: true
          })
        }
      })
    }
  },
  getUserInfo: function(e) {
    console.log(e)
    app.globalData.userInfo = e.detail.userInfo
    this.setData({
      userInfo: e.detail.userInfo,
      hasUserInfo: true
    })
  },

  quit: function() {
    wx.setStorageSync('isUserInfoStored', false)
    wx.redirectTo({
      url: '/pages/login/login',
    })
  },
  // 致谢与说明
  thank: function() {
    wx.showModal({
      title: '致谢与说明',
      content: '感谢您使用讯必达，本程序由2018300410-宁子谦自主开发，作为数据库大作业',
      showCancel: false,
      confirmText: '我知道了'
    })
  },
  // 意见反馈
  advice: function() {

  },
  // 赞赏支持
  like: function() {
    wx.previewImage({
      urls: ['https://i.loli.net/2020/12/09/fAwqMJlDoHF9y7j.jpg'],
    })
  },
  // 分享
  onShareAppMessage: function() {
    return {
      title: '将讯必达分享给朋友',
      path: '/pages/me/me',
      imageUrl: '/pages/images/title.png'
    }
  },
})